import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import 'bootstrap/dist/css/bootstrap.css';
import logo from './entur_logo.jpg';
import Background from './background.jpg'

class SearchField extends React.Component {
    state = {
        query: "",
        data: [],
        filteredData: []
    };

    handleInputChange = event => {
        const query = event.target.value;

        this.setState(prevState => {
            const filteredData = prevState.data.filter(element => {
                return element.name.toLowerCase().includes(query.toLowerCase());
            });

            return {
                query,
                filteredData
            };
        });
    };

    getData = () => {
        fetch(`http://localhost:4000/restaurants`)
            .then(response => response.json())
            .then(data => {
                const { query } = this.state;
                const filteredData = data.filter(element => {
                    return element.name.toLowerCase().includes(query.toLowerCase());
                });

                this.setState({
                    data,
                    filteredData
                });
            });
    };

    componentWillMount() {
        this.getData();
    }

    render() {
        return (
            <div className="searchForm">
                <form>
                    <input
                        placeholder="Search for..."
                        value={this.state.query}
                        onChange={this.handleInputChange}
                    />
                </form>
                <div>{this.state.filteredData.map(i => <p>{i.name}</p>)}</div>
            </div>
        );
    }
}

class NavBar extends React.Component {

    render() {
        return (
            <div className="navBar">
                <div className="logo">
                    <img src={logo} width={180} height={80} />
                </div>
            </div>
        )
    }
}

class Register_box extends React.Component {
    constructor(props) {
        super(props);
        localStorage.setItem("type", "Linje");


        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange(event) {
        window.alert(event.target.value);
        localStorage.setItem('type', event.target.value);
    }

    handleSubmit(event) {
        alert('Your favorite flavor is: ' + this.state.value);
    }

    render() {
        return (
            <form onSubmit={this.handleSubmit}>
                <h3 className="text-center text-white">Registrer ny melding</h3>
                <br></br>
                <div className="form-row d-flex flex-row bd-highlight mb-2 justify-content-center">
                    <div className="fromDate p-2 flex-grow-1">
                        <p className="text-center text-white">Fra</p>
                        <input type="datetime-local" className="form-control"/>
                    </div>
                    <div className="toDate p-2 flex-grow-1">
                        <p className="text-center text-white">Til</p>
                        <input type="datetime-local" className="form-control"/>
                    </div>
                </div>
                <div className="message">
                    <p className="text-center text-white">Melding</p>
                    <input type="String" className="form-control" placeholder="Oppsummering"/>
                    <input type="String" className="form-control" placeholder="Beskrivelse"/>
                </div>
                <br></br>
                <div className="choose_type">
                    <p className="text-center text-white">Søk linje, stopp eller avgang</p>
                    <select className="browser-default custom-select" value={localStorage.getItem('type')} onChange={this.handleChange}>
                        <option selected value="Linje">Linje</option>
                        <option value="Stopp">Stopp</option>
                        <option value="Avgang">Avgang</option>
                    </select>
                </div>
                <div className="search">
                    <input type="String" className="form-control" placeholder="Søk"/>
                </div>
                <SearchField />
                <br></br>
                <br></br>
                <div className="sumbit">
                    <button type="submit" className="btn btn-primary btn-lg btn-block">Submit</button>
                </div>
            </form>



        );
    }
}

class New_SX extends React.Component {
    render() {
        return (
            <div className="new_sx">
                <img id="background" src={ Background } />
                <div className="navBar">
                    <NavBar />
                </div>
                <div className="register_box" >
                    <Register_box />
                </div>
            </div>
        );
    }
}

// ========================================

ReactDOM.render(
    <New_SX />,
    document.getElementById('root')
);
